import React from 'react';
import { ScrollView, Text, View, StyleSheet, Image, TouchableOpacity } from 'react-native';

export default function Student(props) {
    return (
        <ScrollView>
            <View style={styles.container}>
            <View style={styles.card}>
                <Text style={styles.text}>ABC Company</Text>
                <TouchableOpacity onPress={() => alert('Details')}>
                <Image source={{uri: "data:image/png;base64,"}}
                style={{height: 25, width: 40, marginLeft: 50}}></Image></TouchableOpacity>
            </View>
            <View style={styles.card}>
                <Text style={styles.text}>ABC Company</Text>
                <TouchableOpacity onPress={() => alert('Details')}>
                <Image source={{uri: "data:image/png;base64,"}}
                style={{height: 25, width: 40, marginLeft: 50}}></Image></TouchableOpacity>
                
            </View>            
            </View>
        </ScrollView>
    )
}

const styles = StyleSheet.create({
    container: {
        alignItems: 'center',
    },
    text: {
        fontSize: 20,
        color: 'grey',
        marginRight: 60,
        marginLeft: 10,
        width: 150
    },
    text1: {
        fontSize: 30,
        color: 'grey',
        marginRight: 60,
        marginLeft: 30,
        width: 70
    },
    card: {
        marginTop: 20,
        marginLeft: 10,
        borderColor: 'white',
        height:50,
        width: 340,
        backgroundColor:"white",
        borderRadius:15,
        padding:10,
        elevation:10,
        shadowColor: '#000',
        shadowOffset: { width: 0, height: 5 },
        shadowOpacity: 0.5,
        shadowRadius: 5,
        alignItems: 'center',
        flexDirection: 'row'
    },
    number: {
        fontSize: 30,
        marginLeft: -50
    }
})
